import React from "react";
import "./talk.css";

class Talk extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div>
        <ul id="messages">
          <li></li>
        </ul>
        <form action="">
          <input id="m" />
          <button>Send</button>
        </form>
      </div>
    );
  }
}

export default Talk;
